import {
  LOGIN_REQUEST,
  LOGIN_SUCCESS,
  LOGIN_ERROR,
  LOGIN_CANCELED,
  SAVE_TOKEN,
  DELETE_TOKEN,
  LOGGED_OUT,
} from 'store/actionTypes';

export function loginRequest(email: string, password: string) {
  return {
    type: LOGIN_REQUEST,
    email,
    password,
  };
}

export function loginSuccess(status: string) {
  return {
    type: LOGIN_SUCCESS,
    status,
  };
}

export function loginError(status: string) {
  return {
    type: LOGIN_ERROR,
    status,
  };
}

export function loggedOut() {
  return {
    type: LOGGED_OUT,
  };
}

export function loginCanceled(status: string) {
  return {
    type: LOGIN_CANCELED,
    status,
  };
}

export function saveToken(token: string) {
  return {
    type: SAVE_TOKEN,
    token,
  };
}

export function deleteToken() {
  return {
    type: DELETE_TOKEN,
  };
}
